import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar: React.FC = () => {
  const linkStyle: React.CSSProperties = {
    textDecoration: 'none',
    padding: '0.5rem 1rem',
    borderRadius: '4px',
    marginRight: '12px',
    color: '#374151',
  };

  const activeStyle: React.CSSProperties = {
    backgroundColor: '#2563eb',
    color: 'white',
    fontWeight: 'bold',
  };

  return (
    <nav style={{ padding: '1rem', background: '#f9fafb', borderBottom: '1px solid #ddd' }}>
      <NavLink to="/" style={linkStyle} activeStyle={activeStyle}>
        Summary
      </NavLink>
      <NavLink to="/momentum" style={linkStyle} activeStyle={activeStyle}>
        ‚ö° MomentumEdge
      </NavLink>
      <NavLink to="/trend" style={linkStyle} activeStyle={activeStyle}>
        üìà TrendEdge
      </NavLink>
      <NavLink to="/warrior" style={linkStyle} activeStyle={activeStyle}>
        üõ°Ô∏è WarriorEdge
      </NavLink>
      <NavLink to="/tracker" style={linkStyle} activeStyle={activeStyle}>
        Tracker
      </NavLink>
      <NavLink to="/icc" style={linkStyle} activeStyle={activeStyle}>
        ICC Page
      </NavLink>
      <NavLink to="/test" style={linkStyle} activeStyle={activeStyle}>
        Test Harness
      </NavLink>
    </nav>
  );
};

export default Navbar;
